Defendant Daniel Jc Blaesing in court with attorney Michael Hart.  Michele W. Hulgaard appeared for the State of Wisconsin.  Defendant pleads guilty to count #3 and 4.  Court finds the defendant guilty.  State moves to dismiss and read in counts #1 and 2.  Court grants.  States gives its recommendations.  Attorney Hart makes statements.  Daniel Jc Blaesing makes statements.

The Defendant was sentenced to the following:

Count #3
IMPOSED AND STAYED SENTENCE OF:   

90 DAYS Jail Stayed, consecutive to all other sentences (0 days credit)

TERM OF PROBATION:  2 YEAR(S); Concurrent

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with: immediate family members unless given consent by his father and probation officer

COURT COSTS:  $343.00 (to be paid as a condition of probation);

